  `privilege_id` bigint(20) NOT NULL,
  `policy_id` bigint(20) NOT NULL,
  `sort` int(11) NOT NULL DEFAULT '0',
  `tenant_code` varchar(225) DEFAULT NULL COMMENT '所属机构',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

