-- ----------------------------
-- Table structure for `sys_user`
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `login_name` varchar(255) DEFAULT NULL COMMENT '登录名',
  `init_pwd` varchar(255) DEFAULT '64A2BC8B9F47B46A260367825DE7F85A' COMMENT '初始密码',
  `negative_privileges` text COMMENT '负授权权限列表，用逗号隔开',
  `negative_menus` mediumtext,
  `salt` varchar(255) DEFAULT '6C862C5B7732913E1786231F2EACD3CE' COMMENT '加点盐，密码加密用',
  `pwd` varchar(255) DEFAULT '64A2BC8B9F47B46A260367825DE7F85A' COMMENT '登录密码（用户输入），当为null时使用初始密码登录',
  `must_change_pwd_first` tinyint(1) NOT NULL DEFAULT '0' COMMENT '用户登录时若密码未修改，是否强制用户修改，1-是，0-否',
  `user_pwd_valid_days` int(4) DEFAULT NULL COMMENT '用户设置的密码有效天数',
  `user_set_pwd_time` datetime DEFAULT NULL COMMENT '用户设置密码的时间',
  `name` varchar(255) NOT NULL COMMENT '用户名',
  `mobile` varchar(255) DEFAULT NULL COMMENT '手机号码',
  `email` varchar(255) DEFAULT NULL COMMENT '邮件地址',
  `status` varchar(255) DEFAULT 'normal' COMMENT '用户状态 正常 注销',
  `dept_id` bigint(20) DEFAULT NULL COMMENT '主部门',
  `u_group` varchar(255) DEFAULT 'sys_admin' COMMENT '用户所属群组 sys_admin-系统管理组 dept_admin-部门管理组 normal-普通用户组',
  `age` int(2) DEFAULT NULL,
  `gender` int(2) DEFAULT NULL,
  `roles` text COMMENT '所拥有的角色ID列表，用逗号隔开',
  `tenant_code` varchar(255) DEFAULT '1000' COMMENT '所属机构',
  `account` varchar(50) DEFAULT NULL COMMENT '工号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `login_name` (`login_name`)  
) ENGINE=InnoDB AUTO_INCREMENT=30009003534174 DEFAULT CHARSET=utf8;

